import logo from './logo.svg';
import './App.css';
import sisebuto from './reyes/rey_sisebuto.png';
import leogivildo from './reyes/rey_leogivildo.png';
import atanagildo from './reyes/rey_atanagildo.png';

function App() {
  let nombres = ["Sisebuto", "Leogivildo", "atanagildo"];
  return (
    <div className="contenedor">
      <div className='caja'>
        <img src={sisebuto}></img>
        <div className='nombre'>{nombres[0]}</div>
      </div>
      <div className='caja'>
        <img src={leogivildo}></img>
        <div className='nombre'>{nombres[1]}</div>
      </div>
      <div className='caja'>
        <img src={atanagildo}></img>
        <div className='nombre'>{nombres[2]}</div>
      </div>
    </div>
  );
}

export default App;
